import React, { useState } from 'react';

const PredictionCard = ({ title, modelKey, color }) => {
  const [formData, setFormData] = useState({
    id: '',
    open: '',
    high: '',
    low: '',
    volume: ''
  });
  const [prediction, setPrediction] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPrediction(null);
    setError(null);

    try {
      const response = await fetch("http://localhost:5000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ ...formData, model: modelKey })
      });

      const data = await response.json();
      if (response.ok && data.prediction !== undefined) {
        setPrediction(data.prediction);
      } else if (data.error) {
        setError(data.error);
      } else {
        setError("Unknown error occurred.");
      }
    } catch (error) {
      setError("Error connecting to backend.");
    }

    setLoading(false);
  };

  return (
    <div className="card shadow-lg border-0 mb-4" style={{ borderRadius: '1.5rem', maxWidth: '400px', width: '100%' }}>
      <div className="card-body p-4">
        <div className="text-center mb-4">
          <img
            src="https://cryptologos.cc/logos/bitcoin-btc-logo.png"
            alt="Bitcoin"
            style={{ width: '60px', marginBottom: '1rem' }}
          />
          <h4 className="fw-bold" style={{ color }}>{title}</h4>
        </div>
        <form onSubmit={handleSubmit}>
          <div className="mb-2">
            <label className="form-label fw-bold">ID</label>
            <input type="number" className="form-control" name="id" value={formData.id} onChange={handleChange} required />
          </div>
          <div className="mb-2">
            <label className="form-label fw-bold">Open</label>
            <input type="number" className="form-control" name="open" value={formData.open} onChange={handleChange} required />
          </div>
          <div className="mb-2">
            <label className="form-label fw-bold">High</label>
            <input type="number" className="form-control" name="high" value={formData.high} onChange={handleChange} required />
          </div>
          <div className="mb-2">
            <label className="form-label fw-bold">Low</label>
            <input type="number" className="form-control" name="low" value={formData.low} onChange={handleChange} required />
          </div>
          <div className="mb-2">
            <label className="form-label fw-bold">Volume</label>
            <input type="number" className="form-control" name="volume" value={formData.volume} onChange={handleChange} required />
          </div>
          <button type="submit" className="btn btn-warning w-100 fw-bold" disabled={loading}>
            {loading ? "Predicting..." : "Predict"}
          </button>
        </form>
        {prediction !== null && (
          <div className="alert alert-success mt-3 text-center" style={{ fontWeight: 'bold' }}>
            <span role="img" aria-label="rocket">ðŸš€</span> Prediction: {prediction}
          </div>
        )}
        {error && (
          <div className="alert alert-danger mt-3 text-center">
            <strong>Error:</strong> {error}
          </div>
        )}
      </div>
    </div>
  );
};

export default PredictionCard;
